data Token = T AlexPosn Tkn
    deriving (Show)

data Tkn
    = VarIdT      String
    | ConIdT      String
    | VarSymT     String
    | ConSymT     String
--  | QVarIdT     String
--  | QConIdT     String
--  | QVarSymT    String
--  | QConSymT    String
    | IntegerT    Integer
--  | FloatT      String
    | CharT       Char
    | StringT     String
    | SpecialT    Char
    | ReservedOpT String
    | ReservedIdT String
    | EOFT
    deriving (Show)

showPos :: AlexPosn -> String
showPos (AlexPn _ l c) = "line " ++ show l ++ ":" ++ show c

scan :: String -> [Token]
scan str = go (alexStartPos,'\n',str)
    where 
      go inp@(pos,_,str) = case alexScan inp 0 of                         
            AlexEOF -> []                            
            AlexError (p,_,s) -> 
                phasefail  "Lexer Error" $ showPos p ++ " `" ++ [head s] ++ "'"
            AlexSkip  inp' len     -> go inp'        
            AlexToken inp' len act -> act pos (take len str) : go inp'


