alex_action_3 =  \p s -> T p (ReservedOpT s) 
alex_action_4 =  \p s -> T p (VarIdT s) 
alex_action_5 =  \p s -> T p (ConIdT s) 
alex_action_6 =  \p s -> T p (VarSymT s) 
alex_action_7 =  \p s -> T p (ConSymT s) 
alex_action_8 =  \p s -> T p (IntegerT (read s)) 
alex_action_9 =  \p s -> T p (CharT (s!!1)) 
alex_action_10 =  \p s -> T p (StringT s) 
